import axios from 'axios';
let userValue = '';
let data = ':)';
axios.defaults.baseURL = 'https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVinValues/';

const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    axios({
        method: 'get',
        url: userValue+'format=json',
      })
      .then(res=> {data = (JSON.stringify(res, '', 2))})
      .catch(err => console.error(err));
    alert(data);
}
export {getIN, sub};
